import React from 'react'

const Video = (props) => {
    const {video,big} = props;
    let klasa = big ? "video-left-big" : "video-left-small";

    const image = require(`../../images/music/${video}.jpg`);
    return (
        <div className={klasa,"video"} style={{backgroundImage:`url(${image})`}}>

        </div>
    )
}

export default Video
